import React, { useEffect, useState } from "react";


function Reports() {

    const [reports, setReports] = useState([{
        state: '',
        type: '',
        message: ''
    }]);

    useEffect(() => {
        fetch("/reports")
            .then(res => {
                if (res.ok) {
                    console.log(res)
                    return res.json()
                }
            }).then(jsonRes =>
                setReports(jsonRes));
    }, [])


    return <div className="container">
        <h1 className="display-3">Report Page</h1>
       <h2></h2>
    </div>
}

export default Reports;
